INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 110, 1, 0, 1, 0.029, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 105, 1, 1, 122601, 1.5, 101);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (120, 0, 105, 2, 1, 0, 0.014, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 111, 3, 2, 122401, 2.5, 102);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 110, 3, 0, 0, 0.017, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 105, 2, 3, 122501, 2.5, 103);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 110, 4, 1, 0, 0.016, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 105, 3, 4, 107501, 1.5, 104);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 110, 5, 0, 1, 0.014, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 105, 1, 5, 107601, 2.5, 105);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (255, 1, 120, 6, 0, 0, 0.029, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 103, 2, 6, 107801, 3.5, 106);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 120, 7, 0, 1, 0.013, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 103, 1, 7, 110601, 3.5, 107);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 110, 8, 0, 0, 0.014, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 103, 2, 8, 110401, 2.5, 108);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 105, 9, 1, 0, 0.012, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 100, 3, 9, 110501, 1.5, 109);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (200, 0, 105, 10, 0, 1, 0.014, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 103, 1, 10, 115701, 2.5, 110);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 105, 11, 0, 0, 0.071, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 103, 2, 11, 113601, 2.5, 111);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 120, 12, 1, 0, 0.014, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 103, 3, 12, 107901, 1.5, 112);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (200, 0, 110, 13, 0, 1, 0.022, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 105, 2, 13, 108001, 1.5, 113);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 110, 14, 0, 1, 0.031, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 108, 1, 14, 110301, 2.5, 114);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 110, 15, 1, 0, 0.036, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 105, 1, 15, 107701, 0.5, 115);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 110, 16, 0, 0, 0.048, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 95, 2, 16, 113101, 3.5, 116);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 105, 17, 1, 0, 0.043, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 105, 3, 17, 113301, 1.5, 117);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 105, 18, 1, 0, 0.018, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 95, 2, 18, 113201, 1.5, 118);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 110, 19, 0, 1, 0.021, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 108, 2, 19, 117001, 2.5, 119);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (255, 1, 110, 20, 0, 0, 0.036, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 105, 1, 20, 113501, 2.5, 120);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 105, 21, 0, 0, 0.02, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 105, 3, 21, 113401, 2.5, 121);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 110, 22, 1, 0, 0.018, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 105, 1, 22, 110101, 2.5, 122);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 105, 23, 0, 1, 0.03, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 111, 3, 23, 110001, 3.5, 123);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 110, 24, 1, 0, 0.027, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 103, 1, 24, 117201, 1.5, 124);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (160, 0, 105, 25, 0, 1, 0.02, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 108, 2, 25, 117301, 3.5, 125);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 110, 26, 0, 0, 0.04, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 105, 3, 26, 117401, 2.5, 126);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (350, 1, 110, 27, 0, 0, 0.009, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 105, 1, 27, 117101, 3.5, 127);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (255, 1, 120, 28, 0, 0, 0.022, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 105, 1, 28, 122901, 3.5, 128);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 110, 29, 1, 0, 0.028, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 105, 3, 29, 122801, 2.5, 129);
INSERT INTO `v1_d99342c97a582638dba3332ebbf9453dae70b7b2f3455597d4179cb0dc23fea3` VALUES (130, 0, 105, 30, 0, 1, 0.023, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 108, 2, 30, 122701, 3.5, 130);
